蘇澳出水口城隍廟原稱「眾安祠」，主祀大眾爺，創建時間約在日治1920年代，原址位於今蘇澳新站站區範圍鄰近。1984年時，因北迴鐵路闢建之故而遷建現址，位於武荖坑溪右岸， 2008年時，昇格為城隍爺，並將廟名改稱「出水口城隍廟」，時任宜蘭縣長的呂國華並贈「出水口城隍廟」匾。「出水口」係今日蘇澳鎮「後湖」舊稱。 　　出水口城隍廟背倚九股山，面朝新城溪。主祀城隍爺，陪祀地藏王菩薩與福德正神。廟後方有一大室，是安置金斗甕之所。城隍廟外牆有1984年「眾安祠北迴鐵路遷移重建捐獻芳名」碑，廟宇左側另露天立有一尊福德正神像。

